import React from 'react';
import "@google/model-viewer"
import "./ModelViewer.css"

class ModelViewer extends React.Component { 
    render() {
        return (
                <div className="ModlueViewer" style={{ width: 600, height: 300}}>
                <div>
                        <model-viewer ar src="media/3D-files/DSW.gltf" ios-src="media/3D-files/DSWMaterialFinal.usdz" camera-controls poster="media/3D-files/DSW_Poster.png" alt="DSW Chair" background-color="#FFFFFF" auto-rotate ></model-viewer>
                    </div>
                </div>

        )
    }
}

export default ModelViewer;
